import React from 'react';

function Intro() {
  return (
    <div className="intro">
      <div className="name-section">
        <div className="name-text intro-text fade-in-text">Connor</div>
        <div className="name-text intro-text fade-in-text">Gilbert</div>
      </div>

      <div className="about-me-section fade-in-slow">
        <div className="about-me-body intro-text">I am a web developer with experience in react, html, css, javascript, and node.js</div>
      </div>
      <div className='link-section fade-in-slow'>
        <div className='link-text'>
          Welcome
        </div>
      </div>
    </div>
  );
}

export default Intro;
